import React, {Component} from "react"

class ChangeEmail extends Component {
    constructor(props) {
        super(props)
        this.state = {
            redirect: false
        }
    }
    handleSubmit(event) {
        event.preventDefault()

        const user  = localStorage.getItem('user')
        const token = localStorage.getItem('token')

        const data = {
            'user': user,
            'token': token,
            'email': this.state.email
        }

        axios.post('http://localhost:8000/changeemail/', data).then(() => {
            this.setState({redirect: true})
        }).catch((error) => {
            console.log(error)
            alert('Algo deu errado.')
        })
    }
    render() {
        return(
            <div class="container center">
                <div className="card amber darken-2 center-align">
                    <div className="card-title">
                        <h4>Mudar Email</h4>
                    </div>
                    <form method="POST" encType="multipart/form-data" onSubmit={this.handleSubmit}>
                        <div className="card-content white-text">
                            <div className="center">
                                <div className="row">
                                    <label for="input_text">Novo Email</label>
                                    <input id="input_text" type="email" ref="email" placeholder="example@gmail.com" onChange={(e) => {this.setState({email: e.target.value})}} />
                                </div>
                            </div>
                        </div>
                        <div className="card-action">
                            <button type='submit' className="btn waves-effect waves-light orange darken-3">Mudar<i className="material-icons right">send</i></button>
                        </div>
                    </form>
                </div>
            </div>
        )
    }
}

export default ChangeEmail
